import React, { Component } from 'react';


class Header extends Component {
  render() {

    return (
    <div class="jumbotron text-center" style={{marginBottom:0,marginTop:0,backgroundImage:`url('header.png')`}}>
        <h1 style={{color:`#C69722`}}>RoKoBook</h1>
        <p style={{marginBottom:0,marginTop:0}}>Booking para artistas, bookers, managers y concert venues</p>
    </div>

    );
  }
}

export default Header;
